import React from 'react';
import './SectionOne.css';

export default class SectionOne extends React.Component {
  state = {
    bar: false,
    inchka: ' ',
    newlist: '',
  };

  Ber = () => {
    this.setState(() => {
      return {
        inchka: this.state.newlist,
        newlist: 'barlus',
      };
    });
  };

  render() {
    return (
      <div className='sectionone'>
        <i class='fas fa-heartbeat' onClick={this.Ber.newlist}></i>
        <i class='fas fa-heartbeat' onClick={this.Ger}></i>
        <i class='fas fa-heartbeat' onClick={this.Cer}></i>
        <h2>{this.state.newlist}</h2>
      </div>
    );
  }
}
